import React, { Component } from 'react';
import { Container, Row, Col } from 'reactstrap';
import './Home.css';
import Nbrecoutes from './widget/nbrecoutes.js';
import Calendrier from './widget/calendrier.js';
import Genres from './widget/genres.js';

export default class Home extends Component {
  render() {
    return (
      <div class='conteneur'>
        <Row id='widget'>
          <div className="nbrecoutes .col-5 ">
          <Calendrier/>
          </div> 
          <div className="calendrier .col-5">
          <Nbrecoutes/>
          </div> 
     
        
          <div className="genres .col-5">
          <Genres/>
          </div> 
          
        </Row>
      </div>
    );
  }
}
